- Locale: en-US
  Key: ReleaseNotes
  Value: |-
    New
    - Firefox now allows translating selected text portions to different languages after a full-page translation.
    - Enable overscroll animations on Linux as the default behavior for scrollable areas.
    - Firefox now offers an easy way to try experimental features with a new Firefox Lab page in Settings.
    Developer

    Web Platform
    - WebCryptoAPI is now supporting Curve25519 primitives (Ed25519 signatures and X25519 key generation).
